import React from "react";
import './Contact.css';
import { useNavigate } from "react-router-dom";
import NavBar from '../../components/NavBar/NavBar';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFaceGrinBeam } from "@fortawesome/free-solid-svg-icons";

const Contact = () => {
  return (

    <div className="contact-container">
      <header>
        <NavBar/>
      </header>
      <main>
      <div className="contact-div">
          <h1 className="contact-title">Bizimle İletişime Geç!</h1>
          <div className="contact-form">
            <h2 className="contact-form-title"></h2>
            <h3 className="contact-form-info-text">
            Herhangi bir sorunuz, yaşadığınız bir problem ya da öneriniz varsa bizimle iletişime geçmekten çekinmeyin. Size en kısa sürede yardımcı olmaktan mutluluk duyarız.            </h3>
            <div className="contact-form-infos">
              <a><strong>E-posta: </strong>mentup24@gmail.com</a>
              <a><strong>Telefon: </strong>0544 899 27 05</a>
            </div>
            <div className="contact-form-office-hours">
              <a>Destek ekibimiz haftaiçi 09:00 - 18:00 saatleri arasında hizmetinizdedir.</a>
              <a>Mesajlarınız en geç 24 saat içerisinde yanıtlanacaktır.</a>
            </div>
            <div className="contact-form-thanks">
              <a>Teşekkürler! <FontAwesomeIcon icon={faFaceGrinBeam} /></a>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Contact;
